{"reasoning":"The ground-truth bug focuses on animation/physics: the character moves or translates across the ground without the normal walking animation (“sliding”). There is no mention of the character sinking into or passing through the floor mesh. 

The generated report, however, describes geometry intersection – the model visibly clips through the floor surface. That is a different visual problem related to character position relative to the floor, not to the absence of step animation or a sliding motion.

Because the symptoms and underlying issues differ (sliding vs. clipping), the two reports do not describe the same bug.","match":false}

{"reasoning":"Ground truth bug: a character standing near a window is suddenly launched upward and ends up walking on top of the roof. Key symptoms: abrupt projection into the air, position change from window area to roof, continues normal walking motion on the roof surface.

Generated report: character already on the roof is "clipping through" (interpenetrating) the roof geometry. No mention of sudden launch, change in position, or walking on roof after being propelled. The visual problem described (interpenetration) differs from the ground-truth behavior (unexpected teleport/physics impulse).

Because the core symptoms and underlying issues are different, the two reports do not describe the same bug.","match":false}

{"reasoning":"Ground truth: NPC is on the roof, its mesh becomes heavily distorted, and distortion increases as the car moves. Core symptom = mesh deformation tied to car movement.

Generated report: NPC is “stuck on top of car,” does not move with the car, and clips through the car. Core symptoms = lack of attachment / desync and clipping, no mention of mesh deformation or worsening distortion.

Although both involve a character on a car roof, the visual problems described are different: distortion vs clipping / immobility. Therefore they do not describe the same underlying bug.","match":false}
